import React from 'react';
import { Button } from 'semantic-ui-react'
import './nav.css';

const Nav=() => {
    return(
        <nav className='topnav'>   
        <a href="#">Inicio</a>
        <a href="#">Contacto</a>
        <a href="#">Quienes somos</a>
        <Button>Click Here</Button>
        <p>JABB</p> 
        </nav>
    )
}

export default Nav;
